import React from 'react';
import 'Header.css';

function HeaderForms() {
  return (
    <header>
      <h1 class="title">Team Sign Up</h1>
      <nav class="navegacao">
        <ul>
          <li class="active"><a href="TelaUm">Basic</a></li>
          <li><a href="TelaDois">Social</a></li>
          <li><a href="TelaTres">Certificates</a></li>
        </ul>
      </nav>
    </header>
  );
}

export default HeaderForms;
